INSERT INTO public.resource (id, created, description, mir_id, modified, name, official, provider_code, resource_home_url, sample_id, url_pattern, contact_person_id, institution_id, location_country_code, namespace_id, deprecated, deprecation_date, protected_urls, render_protected_landing, auth_help_url, auth_help_description, deprecation_offline_date, deprecation_statement, render_deprecated_landing) VALUES (2169, '2020-03-24 05:11:19.676000', 'DANDI is a Web platform for scientists to share, collaborate, and process data from cellular neurophysiology experiments. DANDI works with BICCN and other BRAIN Initiative awardees to curate data using community data standards such as NWB and BIDS, and to make data and software for cellular neurophysiology FAIR (Findable, Accessible, Interoperable, and Reusable). DANDI will store electrical and optical cellular neurophysiology recordings and associated MRI and/or optical imaging data. DANDI will provide: 1) A cloud platform for neurophysiology data storage for the purposes of collaboration and dissemination of data; 2) Easy to use tools for neurophysiology data submission, visualization, and access in the archive; and 3) Standardized applications for data ingestion, visualization and processing, which facilitate adoption of NWB and other standards. These data will help scientists uncover and understand cellular level mechanisms of brain function. Scientists will study the formation of neural networks, how cells and networks enable functions such as learning and memory, and how these functions are disrupted in neurological disorders.', 'MIR:00000750', '2020-03-24 05:11:19.676000', 'DANDI: Distributed Archives for Neurophysiology Data Integration', true, 'dandi', 'https://dandiarchive.org/', '000017', 'https://dandiarchive.org/dandiset/{$id}', null, 2167, 'US', 2168, false, null, false, false, null, null, null, null, false);
