create table resource
(
    id                        bigint                not null primary key,
    created                   timestamp             not null,
    description               varchar(2000),
    mir_id                    varchar(255)          not null unique,
    modified                  timestamp,
    name                      varchar(255)          not null,
    official                  boolean               not null,
    provider_code             varchar(255),
    resource_home_url         varchar(2000)         not null,
    sample_id                 varchar(255),
    url_pattern               varchar(2000)         not null,
    contact_person_id         bigint,
    institution_id            bigint                not null references institution,
    location_country_code     varchar(255)          not null references location,
    namespace_id              bigint                not null references namespace,
    deprecated                boolean default false not null,
    deprecation_date          timestamp,
    protected_urls            boolean default false not null,
    render_protected_landing  boolean default false,
    auth_help_url             varchar(255),
    auth_help_description     varchar(2000),
    deprecation_offline_date  timestamp,
    deprecation_statement     varchar(255),
    render_deprecated_landing boolean default false not null
);

alter table resource
    owner to devusername;

create index idx_official
    on resource (official);

Study is an umbrella Project that broadly defines the overall goal of a research proposal. It consists of sequencing projects along with corresponding organism or Biosample information as well as any analysis done on the sequencing projects.
E.g., Gs0016050: Human Microbiome Project (HMP), Gs0000008: A Genomic Encyclopedia of Bacteria and Archaea (GEBA) study.
Biosample is the description of the environment from where the DNA/RNA sample was collected. Currently GOLD Biosample entities are defined for all metagenome and metatranscriptomes projects, i.e. for non-isolate genomes. E.g., Gb0055733
Organism is an individual living thing. It can be a bacterium, plant, fungus etc. In GOLD, all isolate or single cell genome sequencing projects are associated with an organism. Additionally, GOLD Organisms are also created for genomes assembled from metagenome sequences(MAGs). E.g., Go0003442
Sequencing Project represents the procedures undertaken for generating sequencing output from an individual Organism or Biosample. An individual genome project may be composed of more than one sequencing reactions and/or sequencing technologies. A Sequencing Project may be an isolate genome, or a metagenome, transcriptome, or metatranscriptome etc.
E.g., Gp0003442
Analysis Project represents the computational processing of sequencing data generated by a sequencing project. It describes how the assembly and annotation of a Sequencing Project were performed. 
