The HEAL Platform represents a dynamic Data Ecosystem that aggregates and hosts data from multiple resources to make data discovery and access easy for users.

The platform provides a way to search and query over study metadata and diverse data types, generated by different projects and organizations and stored across multiple secure repositories.

The HEAL platform also offers a secure and cost-effective cloud-computing environment for data analysis, empowering collaborative research and development of new analytical tools. New workflows and results of analyses can be shared with the HEAL community to enable collaborative, high-impact publications that address the opioid crisis.', 'MIR:00000941', '2022-02-27 20:39:04.401000', 'The HEAL Platform', true, 'dg.h34L', 'https://healdata.org/', '022911d6-af91-4b02-8f96-9107c77c98b8', 'https://healdata.org/ga4gh/drs/v1/objects/{$id}', null, 2820, 'US', 3186, false, null, false, false, null, null, null, null, false);
